sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    inputs = utils.trimStringInputs(inputs);

  if (utils.isEmpty(inputs.customer) && utils.isEmpty(inputs.domain))
        throw new Error("Either Customer or Domain must be provided");

    outputs.customer = inputs.customer;
    outputs.domian = inputs.domian;
    outputs.max_result = inputs.max_result;
    outputs.sort_order = inputs.sort_order;
    outputs.view_type = inputs.view_type;
    outputs.order_by = inputs.order_by;
    outputs.projection = inputs.projection;
    outputs.custom_feild_mask = inputs.custom_feild_mask;
    outputs.show_deleted = inputs.show_deleted;
})(inputs, outputs);

